  * //                                          | add sub-molecule
  * m(Article.name.author + Tag.category.weight + Publisher.name).get.map(_ ==> List(
  *   (("Battle of Waterloo", "Ben Bridge"), ("History", 5), "Bestseller Publications Inc.")
